INSERT INTO `comments` VALUES (59799,'xOQvViY28S72S-tFFB0Tbw',270819,'can you upload some pictures?','2016-07-12 17:57:33','2016-07-12 17:57:33',26619),(59800,'rWb8i1RFgyWN0Y72F_Q8JA',270819,'I\'m having trouble getting them loaded. I have loaded one but need to work on others. Thanks','2016-07-12 18:13:36','2016-07-12 18:13:36',26619),(59826,'xOQvViY28S72S-tFFB0Tbw',271063,'do you have any pics you can upload? ','2016-07-13 01:38:28','2016-07-13 01:38:28',26619),(59827,'qk_ZcSSsvORgGfzqLAtTHQ',271063,'Yesvi will do it later..','2016-07-13 01:39:43','2016-07-13 01:39:43',26619),(59829,'xOQvViY28S72S-tFFB0Tbw',271100,'got any pics?','2016-07-13 04:28:32','2016-07-13 04:28:32',26619),(59830,'VPIIz5NmwhFW4wGadGzmZg',271100,'Yes but I can\'t seem to upload them I will keep trying','2016-07-13 04:30:05','2016-07-13 04:30:05',26619),(59832,'VPIIz5NmwhFW4wGadGzmZg',271100,'OK I got them uploaded','2016-07-13 05:04:23','2016-07-13 05:04:23',26619),(59867,'qk_ZcSSsvORgGfzqLAtTHQ',271063,'My pay pal is set  up to receive payments but not through you','2016-07-13 11:22:40','2016-07-13 11:22:40',26619),(59873,'xOQvViY28S72S-tFFB0Tbw',271187,'Hey Maureen, we ask that you only post actual items that you have for sale. It\'s hard to ensure our buyers safety when it comes to giveaways/fundraisers/raffles\n\nHope you understand, and if you send me more info I can share it on our Facebook page!','2016-07-13 13:34:48','2016-07-13 13:34:48',26619),(59931,'xOQvViY28S72S-tFFB0Tbw',271456,'i want this so bad, but i wouldn\'t know what to do with it.','2016-07-14 00:13:01','2016-07-14 00:13:01',26619),(59939,'sUARYUSd8UFSL3C1S-sRvA',271509,'I wish I could fit into these gorgeous chaps.  Bought them thinking I could squeeze into them (you now the lose the weight program) but unfortunately my loss is your gain.  Literally.  Great for show or trail, it doesn\'t matter.  They are like new and the embellished rose yolk design is very unique.  You can see from the photos they are fringed and embellished with conchos.','2016-07-14 03:48:00','2016-07-14 03:48:00',26619),(60022,'xOQvViY28S72S-tFFB0Tbw',271719,'pics?','2016-07-14 17:08:45','2016-07-14 17:08:45',26619),(60026,'J5vOGfWm48bKfXCt2f0_qg',271719,'Pics will be available tonight','2016-07-14 17:23:13','2016-07-14 17:23:13',26619),(60062,'xOQvViY28S72S-tFFB0Tbw',271970,'any pics? i\'ll include this in our news letter if you can get some up in the next few days! sounds nice','2016-07-15 03:19:25','2016-07-15 03:19:25',26619),(60073,'P0usHZm3WBoRAasKbR8UKA',271994,'baker9592@gmail.com','2016-07-15 06:17:12','2016-07-15 06:17:12',26619),(60088,'mB1EQ7zOlfmVANnkm4xy6A',271185,'Can you please tell me what kind of girth you use with this saddle?','2016-07-15 11:49:19','2016-07-15 11:49:19',26619),(60090,'DaHiO2Qxc6foE9gx6j3nBQ',271185,'Hi Cydney,\n\nIt take a regular western girth.','2016-07-15 12:23:52','2016-07-15 12:23:52',26619),(60091,'DaHiO2Qxc6foE9gx6j3nBQ',271185,'sorry \"Takes\" : )','2016-07-15 12:24:13','2016-07-15 12:24:13',26619),(60093,'mB1EQ7zOlfmVANnkm4xy6A',271185,'Is this the equitation endurance or the plantation model?\n','2016-07-15 12:31:57','2016-07-15 12:31:57',26619),(60094,'DaHiO2Qxc6foE9gx6j3nBQ',271185,'Oh gosh, I don\'t know.  How would I find that out?','2016-07-15 12:37:39','2016-07-15 12:37:39',26619),(60101,'mB1EQ7zOlfmVANnkm4xy6A',271185,'I compared some photos and yours is the river plantation saddle. This is the equitation model: http://www.tucker-saddles.com/equitation-endurance-saddle.html \n\nYou have a very nice saddle. Not what I\'m looking for but you should have no problem selling it. Thanks for answering my questions.\n\n','2016-07-15 12:50:36','2016-07-15 12:50:36',26619),(60102,'DaHiO2Qxc6foE9gx6j3nBQ',271185,'Yes, I just looked it up too.  Seems like one big difference is the knee rolls which mine does not have.  Thanks for asking and good luck with your search!','2016-07-15 12:53:17','2016-07-15 12:53:17',26619),(60105,'mB1EQ7zOlfmVANnkm4xy6A',271185,'There is also a difference in the seat position of the 2 saddles. The equitation endurance model is unique among all the other Tucker saddles. The stirrup placement makes for more of an equitation seat compared to the sit-back-relax seat of the other Tuckers.','2016-07-15 13:28:27','2016-07-15 13:28:27',26619),(60107,'N9CsdEr9u6WbXGauTckHkA',272097,'looks like a great bargain','2016-07-15 13:48:06','2016-07-15 13:48:06',26619),(60140,'xOQvViY28S72S-tFFB0Tbw',272244,'got any pics? i\'ll include it in our newsletter if so!','2016-07-16 01:32:38','2016-07-16 01:32:38',26619),(60143,'D-MA9kd0lMqzFulyp3EbSQ',271970,'Yes for sure! I will put up some pictures right now! it would be great if you could get it up on there please! Thank you very much!\n','2016-07-16 03:07:26','2016-07-16 03:07:26',26619),(60144,'YpdRRK705LmO_SWhpQNRoQ',272300,'Hi!! Do either of these bridles you have for sale come with reins? Thanks!! ','2016-07-16 03:17:20','2016-07-16 03:17:20',26619),(60155,'KDnY1XGHTq-uXlwUh4M1Fg',272372,'for sale chaps black and teal in excellent condition call me or text me at 906-934-3345','2016-07-16 12:05:58','2016-07-16 12:05:58',26619),(60157,'KDnY1XGHTq-uXlwUh4M1Fg',272373,'great for nice summer rides or fun in the snow its has runners also,,, text me or email me 906-934-3345','2016-07-16 12:16:00','2016-07-16 12:16:00',26619),(60159,'Bgqd7wbaw-WIeQnm3sO4WQ',269925,'Hi could you contact me about purchasing please. ','2016-07-16 14:59:01','2016-07-16 14:59:01',26619),(60166,'SQPkqaKPaTAvzZP1laJWYw',271429,'Seat size?','2016-07-16 19:11:27','2016-07-16 19:11:27',26619),(60167,'9y0uWU9zImuQ69SeSKoo-A',272300,'Yes! They both do!','2016-07-16 19:18:42','2016-07-16 19:18:42',26619),(60176,'mE-PfgLSFjEuAOBaUiex1g',271429,'Sorry - it must have gotten cut off - 18.\n','2016-07-16 20:54:04','2016-07-16 20:54:04',26619),(60233,'xOQvViY28S72S-tFFB0Tbw',272600,'got any pics? sounds nice.','2016-07-17 22:29:39','2016-07-17 22:29:39',26619),(60234,'xOQvViY28S72S-tFFB0Tbw',272747,'got any pics?\n','2016-07-17 22:29:56','2016-07-17 22:29:56',26619),(60235,'i74Pape6WKVVz4rG0uW7GA',272747,'I just added a couple!  I can get a picture of the serial number and tree size tomorrow if you\'d like! ','2016-07-17 22:33:56','2016-07-17 22:33:56',26619),(60236,'b_5Pg76G_9IQaKLvcsQ_ig',272600,'Added :)','2016-07-17 22:35:41','2016-07-17 22:35:41',26619),(60251,'wWgKxb4W1qaRt1GoQCty-g',271912,'Is this saddle still available?','2016-07-18 04:09:36','2016-07-18 04:09:36',26619),(60283,'A_nk88Lq659SOOdWIWc9Aw',271912,'It is','2016-07-18 15:59:36','2016-07-18 15:59:36',26619),(60330,'xOQvViY28S72S-tFFB0Tbw',273136,'got any pics?\n','2016-07-19 01:16:50','2016-07-19 01:16:50',26619),(60353,'pKuiyDrCHS2n2AaVX4Lj6g',273235,'No PAYPAL acct. Pick-up only.','2016-07-19 10:24:56','2016-07-19 10:24:56',26619),(60355,'pKuiyDrCHS2n2AaVX4Lj6g',273235,'Cash on collection.','2016-07-19 10:28:17','2016-07-19 10:28:17',26619),(60367,'aRNdW3pH8IWWYgv8HkIR1g',271509,'What are the measurements - waist,thigh, length? Thanks','2016-07-19 14:36:55','2016-07-19 14:36:55',26619),(60399,'xOQvViY28S72S-tFFB0Tbw',273435,'can you upload a few pics when you get a chance?','2016-07-19 20:44:55','2016-07-19 20:44:55',26619),(60405,'xOQvViY28S72S-tFFB0Tbw',273526,'is this a duplicate listing? keep in mind people can purchase both listings so if you only have one item for sale you\'ll want to close the old listing.','2016-07-20 00:02:12','2016-07-20 00:02:12',26619),(60506,'pAnpq61cyLG-OImMYkSjqg',273526,'thanks for the alert. I thought I only posted it once.','2016-07-20 23:10:46','2016-07-20 23:10:46',26619),(60512,'sUARYUSd8UFSL3C1S-sRvA',271509,'Hi Susan.  I don\'t have them with me at the moment as I am at my fianc\'s place for the week.  Let me see if I can get that info for you soon.\nDodge','2016-07-21 01:26:25','2016-07-21 01:26:25',26619),(60621,'xOQvViY28S72S-tFFB0Tbw',274647,'got any pics?','2016-07-23 01:20:16','2016-07-23 01:20:16',26619),(60626,'sUARYUSd8UFSL3C1S-sRvA',271509,'Hi Susan\nI didn\'t realize how hard it is to measure chaps.  First of all they are a size small.   I wear an 8 and they are too small for me.  The MAX that the waist/hip can buckle to is 37\" prox and they can buckle as small as 31 prox.  The length from the top of the yoke band to the bottom cut hem is about 40\".  I tried to do a thigh knee ankle measurement too which is really vague.  The metal zipper is 28 3/4\".  I would say the thigh is about 18\" the knee 14\"?  Hope that helps.\nDodge','2016-07-23 03:44:56','2016-07-23 03:44:56',26619),(60822,'ng-m4a3FIjQmamJ4Rf5WQQ',272413,'Is it $60 for both? Will the black fit a 38\" chest?','2016-07-26 01:24:27','2016-07-26 01:24:27',26619),(60825,'Xsu9wdMHwrkxV4LnKm5-Zg',272413,'I can measure it for you and let you know.  I think it will.  I was asking $60 each, but am somewhat negotiable.','2016-07-26 04:25:11','2016-07-26 04:25:11',26619),(60834,'vr4ApsoQnThnJFgIIYfxjw',269926,'Can you please tell me the age and make of the saddle?','2016-07-26 09:59:35','2016-07-26 09:59:35',26619),(61049,'vr4ApsoQnThnJFgIIYfxjw',269926,'Can you please tell me the make of the saddle and send additional photos if possible?','2016-07-29 12:10:56','2016-07-29 12:10:56',26619),(61052,'R54ecqnx9NlPDD0Bop4Rcw',269926,'This saddle has been sold I have a Crosby  equilibrium for sale like brand new 16.5 medium tree. Asking $500 can send pictures if interested ','2016-07-29 12:23:17','2016-07-29 12:23:17',26619);
