INSERT INTO `community_customizations` VALUES (32977,26619,'en','Tack Hunter','The New Way To Shop For Tack','Shop the tack trunks of riders across america and sell yours too!','2016-07-07 17:18:26','2016-07-19 01:39:02',NULL,'<p>\nWelcome to Tack Hunter! Have some extra tack laying around? You can easily list and sell your used tack on Tack Hunter! Feel free to reach out&nbsp;to me personally&nbsp;with any feedback or issues, my email is katy@tackhunter.com</p>\n<p>\nLove,<br><i>The Tack Hunter crew</i>\n</p>','<h1><p style=\"text-align: left;\"><br></p></h1><div><div style=\"text-align: left;\"><b style=\"font-size: 1em; line-height: 1.5em;\">What\'s this all about?</b></div><div style=\"text-align: left;\"><span style=\"font-size: 1em; line-height: 1.5em;\">Tack Hunter makes it easy to buy &amp; sell tack online. We work with individual sellers and small businesses around the globe to bring you a great selection of tack &amp; apparel products. Want to make some extra cash by selling your old tack? You can do that too. &nbsp;Just Sign Up and \"Post a New Listing.\" &nbsp;</span></div><div style=\"text-align: left;\"><br></div></div><div style=\"text-align: left;\"><b>Who can join?</b><br></div><div style=\"text-align: left;\"><span style=\"font-size: 1em; line-height: 1.5em;\">Anyone can join! &nbsp;But not everyone can stay necessarily. &nbsp;We will continually pour over reviews, transactions and listings in order to&nbsp;maintain legitimacy and trust within the community. &nbsp;We think Tack Hunter&nbsp;can be a great&nbsp;thing for the whole community, but we need your help to make sure that the right folks are involved.</span><br></div><div><div style=\"text-align: left;\"><br></div><a href=\"https://www.tackpal.com/en/listings/new\"></a><p></p></div><div style=\"text-align: left;\"><b>What is the cost?&nbsp;</b></div><div style=\"text-align: left;\">Tack Hunter&nbsp;is completely FREE to list and buy items. Buyers simply pay the amount being asked for a product, plus shipping. Sellers pay nothing if they share their item on facebook, or in a tack group on facebook, otherwise sellers&nbsp;pay Tack Hunter&nbsp;a 3% commission (only if their product sells). &nbsp;<b><br></b></div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><b>How do sellers get paid?</b><br></div><div style=\"text-align: left;\">Tack Hunter&nbsp;is fully integrated with PayPal and sellers must have a PayPal account to get paid for their listings. PayPal is FREE, easy, and offers both buyer and seller protection. To signup for a free PayPal account,&nbsp;<a href=\"https://www.paypal.com/upgrade\" target=\"_blank\">click here</a>. Once a product sells, the money is immediately transferred to your PayPal account.&nbsp;</div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><b>How can buyers pay for my listings?</b></div><div style=\"text-align: left;\">Tack Hunter&nbsp;accepts Visa, Mastercard, Discover, American Express and PayPal.&nbsp;<b><br></b></div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><b>Shipping vs. Pickup?</b></div><div style=\"text-align: left;\">In most cases, you will want to offer shipping as an option to potential buyers. Set a shipping price that covers shipping to most locations. If a buyer lives internationally or requires expedited shipping, &nbsp;the details can be worked out in the message thread that opens with each order.&nbsp;</div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><b>Report a problem with an order</b></div><div><div style=\"text-align: left;\">If you\'re experiencing an issue with an order, our first recommendation is that you&nbsp;<b>contact the seller directly</b>&nbsp;for help.&nbsp;</div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\">Tack Hunter&nbsp;provides sellers with a platform to sell their items and become small business owners. When you purchase from an Tack Hunter&nbsp;seller, you are buying from a unique shop, and not TackPal&nbsp;itself.&nbsp;</div><div style=\"text-align: left;\"><span style=\"font-size: 1em; line-height: 1.5em;\">T</span><span style=\"font-size: 1em; line-height: 1.5em;\">ack Hunter</span><span style=\"font-size: 1em; line-height: 1.5em;\">&nbsp;</span><span style=\"font-size: 1em; line-height: 1.5em;\">is not directly involved in the transaction between buyers and sellers. We encourage you to&nbsp;</span><strong style=\"font-size: 1em; line-height: 1.5em;\">communicate</strong><span style=\"font-size: 1em; line-height: 1.5em;\">&nbsp;</span><strong style=\"font-size: 1em; line-height: 1.5em;\">directly</strong><span style=\"font-size: 1em; line-height: 1.5em;\">&nbsp;with sellers through our onsite messaging system.</span><br></div></div><div style=\"text-align: left;\"><span style=\"font-size: 1em; line-height: 1.5em;\"><br></span></div><div style=\"text-align: left;\"><i>BEFORE YOU PLACE AN ORDER</i></div><div><p style=\"text-align: left;\">Here are some examples of questions that your seller can help you with:</p><ul><li><p style=\"text-align: left;\">Shipping information (<em>Can you send my order to New Zealand? Can it be shipped faster?)</em></p></li><li><p style=\"text-align: left;\">Processing times (<em>Will I get this in time for Christmas?</em>)</p></li><li style=\"text-align: left;\">Shop policies (<em>Can I return this if it doesnt fit?</em>)</li></ul></div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\">In the event that you\'re unable to resolve your issue directly, or&nbsp;If you havent received your order,&nbsp;you can report a problem to Tack Hunter&nbsp;by opening a case. Please&nbsp;<a href=\"https://www.tackpal.com/en/user_feedbacks/new\">contact us</a>&nbsp;and we will work to promptly resolve your dispute.&nbsp;</div><div><a href=\"https://secure.jotform.us/form/51538128669162\" target=\"_blank\"></a></div><div></div>','<h2><div><b>Tack&nbsp;Hunter&nbsp;i</b><b>s a marketplace where people&nbsp;connect&nbsp;&nbsp;to buy &amp; sell&nbsp;tack.&nbsp;</b><br></div><div><br></div><div><p>Horse owners are certainly some of the most passionate people anywhere or anyplace.&nbsp; Most understand that keeping a horse well equipped requires some effort, and to keep costs as low as possible selling and buying products between horse enthusiasts is very common.&nbsp;</p><p>Tack Hunter&nbsp;was founded to fill a need for an online community where equestrians could sell their tack and horse related products.&nbsp;We\'ve removed the need to go to multiple places, and brought everything to one place which easy to understand and simple to use.&nbsp; It\'s a win/win all around.</p><p>We would&nbsp;<b>LOVE</b>&nbsp;to hear your feedback, you can always&nbsp;contact me personally&nbsp;at katy@tackhunter.com!</p></div></h2><div></div><p></p>',NULL,'<h3>\nRegistrar\n</h3>\n<p>\nTack Hunter service: Sharetribe Ltd\n<br>\n<a href=\"http://www.sharetribe.com/en\">www.sharetribe.com</a>\n<br>\ninfo (at) sharetribe.com\n</p>\n<h3>\nContact person\n</h3>\n<p>Phillip Robertson<br>admin@tackhunter.com</p>\n<h3>\nName of the register\n</h3>\n<p>\nUser register of the Tack Hunter service\n</p>\n<h3>\nUse of personal details (purpose of register)\n</h3>\n<p>\nPersonal details are collected to make communication and use of service possible. Details can be used for communication between service providers and users and also for direct communication between users. Some personal details are visible on the profile page of the user, but those details are voluntary (except name).\n</p>\n<p>\nThe handling of personal details is not outsourced, but the register data is stored on a server that is rented from a third party company.\n</p>\n<h3>\nInformation content of the register\n</h3>\n<p>\nThe following information may be stored in the register:\n</p><ul>\n<li>\nPersonal details: Name, email address, phone number, street address\n</li>\n<li>\nAccount details: username, password (stored in encrypted format)\n</li>\n<li>\nThe description text that the user may write about him/herself\n</li>\n<li>\nThe offers and requests the user has posted to the service\n</li>\n<li>\nThe given and received feedback and badges\n</li>\n<li>\nStatistical data about service usage, e.g. number times the user has logged in\n</li>\n</ul>\n<p></p>\n<h3>\nRegular sources of information\n</h3>\n<p>\nPersonal details are given by the user on registration to the service or when using it later.\n</p>\n<h3>\nRegular handovers of the information\n</h3>\n<p>\nThe information may be handed over for research purposes as described in the\n<a href=\"/en/infos/terms\">Terms of use</a>\nthat the user accepts before starting to use the service. The researchers may not publish any research results so that identifying information would be revealed or that any specific user could be detected.\n</p>\n<p>\nInformation considering users of a single Tack Hunter community may be handed over to the client who has founded that community or to the community administrators appointed by that client.\n</p>\n<h3>\nTransfers of the information outside the EU and the European Economic Area\n</h3>\n<p>\nInformation may be stored to a server that may be located inside or outside of the EU and the European Economic Area\n</p>\n<h3>\nRegister protection principles\n</h3>\n<p>\nThe information is stored on computers. The access to the information is restricted with passwords and physical access to the computers is restricted by the server hosting company.\n</p>',NULL,NULL,NULL,NULL,'what are you looking for?',NULL,NULL);
