INSERT INTO `feedbacks` VALUES (32758,'Saw this on COTH forums. How much is the commission fee? Great idea, btw!!','Anonymous','https://www.tackhunter.com/','2016-07-08 21:38:10','2016-07-08 21:38:10',0,'Spotcular@yahoo.com',26619),(32838,'I was invited to post my Circle Y western saddle on this group.  I created an account, and then you don\'t even offer the option for western tack.  This is total BS.  This is the person who sent me the inquiry.  Shame on her!\r\n\r\nSender Name: Katy G.\r\nReply-To Email: katyg1174@gmail.com','clDr9txCFzO0H1TLrxr1jw','https://www.tackhunter.com/en/listings/new','2016-07-12 23:30:25','2016-07-12 23:30:25',0,'cmesk82@aol.com',26619),(32839,'Still can\'t find where to put pay pal info','VPIIz5NmwhFW4wGadGzmZg','https://www.tackhunter.com/en/mel','2016-07-13 05:12:08','2016-07-13 05:12:08',0,'woodyandme203@gmail.com',26619),(32851,'How do I delete a listing?  ','5Bg_I6f45MfIQMK09D4k7g','https://www.tackhunter.com/en/selltackhunter4/settings','2016-07-13 18:26:37','2016-07-13 18:26:37',0,'wildmaresnw@yahoo.com',26619),(32885,'Please stop having people reply to every saddle I have on tacktrader telling me to post here.  ','Anonymous','https://www.tackhunter.com/','2016-07-14 23:47:21','2016-07-14 23:47:21',0,'spokanetacktrunk@yahoo.com',26619),(32887,'Please stop emailing every one of my tacktrader ads. I was interested in your site, but not it seems shady.  I\'ve been emailed by 2 different names with multiple emails.  Please stop','Anonymous','https://www.tackhunter.com/?view=list','2016-07-15 02:26:54','2016-07-15 02:26:54',0,'Spokanetacktrunk@yahoo.com',26619),(32897,'I don\'t know where to enter the payment information that Kate G. said that I need to have on my ad.','W_8WNlUenf_yPcpaEKhL6g','https://www.tackhunter.com/en/infos/terms','2016-07-15 15:05:12','2016-07-15 15:05:12',0,'hebooks@yahoo.com',26619),(32901,'In one place it says you charge a 3% fee and another says 5%. I\'m just curious which one it is?\r\n\r\nThanks.','qR2fmeNqLn4GAPwsGFtiQg','https://www.tackhunter.com/en/kradosa/settings/payments/paypal_account','2016-07-15 18:03:54','2016-07-15 18:03:54',0,'kkmrad93@gmail.com',26619),(32915,'I am a little confused about the 1% listing fee if the item sells....I thought I saw something that said if you shared your item on FB then you would not have to pay the 1% fee?','Xsu9wdMHwrkxV4LnKm5-Zg','https://www.tackhunter.com/','2016-07-16 16:48:57','2016-07-16 16:48:57',0,'donaeec@yahoo.com',26619),(33141,'Hi, I don\'t have PayPal any longer due to too many issues. I\'m not sure how to go about deleting my account? ','0eiYhU6WDT9vlzJUkOlpgw','https://www.tackhunter.com/en/jessical/settings/payments/paypal_account','2016-07-26 11:03:57','2016-07-26 11:03:57',0,'fivecardstudpts@gmail.com',26619);
