INSERT INTO `messages` VALUES (396290,'xOQvViY28S72S-tFFB0Tbw','Hey Shane, \r\n\r\nCan you go to settings > payments, and link your paypal account so that you can accept payments in the event that your item sells? \r\n\r\nThanks!\r\nPhillip / Tackhunter','2016-07-10 15:03:18','2016-07-10 15:03:18',155837),(396292,'xOQvViY28S72S-tFFB0Tbw','Hey Caroline,\r\n\r\nCan you go to settings > payments and link your paypal so that you can accept payments in the event that your item sells. \r\n\r\nThanks!\r\nPhillip/Tackhunter','2016-07-10 15:09:40','2016-07-10 15:09:40',155838),(396297,'xOQvViY28S72S-tFFB0Tbw','kiss my butt','2016-07-10 15:25:00','2016-07-10 15:25:00',155839),(396298,'xOQvViY28S72S-tFFB0Tbw','Hey Elizabeth,\r\n\r\nCan you go to settings > payments and link your paypal so that you can accept payments in the event that your item sells.\r\n\r\nThanks!\r\nPhillip/Tackhunter','2016-07-10 15:26:07','2016-07-10 15:26:07',155840),(396307,'zCbYTJlHA3h08RQCoybCrw','go fuck a duck >:3','2016-07-10 15:37:18','2016-07-10 15:37:18',155839),(396458,'xOQvViY28S72S-tFFB0Tbw','Hey Gaynor,\r\n\r\nCan you navigate to settings -> payments and link your paypal, so that you can accept payments in the event that your item sells.\r\n\r\nThanks!\r\nPhillip/Tackhunter','2016-07-10 21:04:13','2016-07-10 21:04:13',155907),(396482,'XJKbYG8znIDYM-J6FV2TiQ','I have never had to do that before on other selling sights..could you explain','2016-07-10 22:05:18','2016-07-10 22:05:18',155907),(396490,'xOQvViY28S72S-tFFB0Tbw','Sure, \n\n\nThe reason you need to approve your paypal account is when people click \"buy\" they need to be able to send you your payment via paypal.\n\nits the same way ebay works: when someone buys your item,  they send you a payment to your paypal account. \n\nkeep in mind that tackhunter never recieves any info about your paypal account, and none of that information is shared with tackhunter, it\'s basically just allowing users to send you payments from our websites portal.\n\nLastly, keep in mind that a small fee (3%) is collected if the item sells. this is just to help keep the site up and running.\n\n\n- Phillip','2016-07-10 22:19:25','2016-07-10 22:19:25',155907),(396522,'syHlY7yudSvFM8q17P2X2Q','Hey Julie,\r\n\r\nThanks so much for joining and a making a listing, we\'re glad to have you.\r\n\r\nQuick question: are you able to list your items individually? A lot of time our buyers will want to buy one item out of the lot, so creating individual listings makes it a lot easier to keep track of which items sold, and helps users find them easier via search.\r\n\r\nIf you need any help at all let me know!\r\n\r\n- Katy / The Tack Hunter crew','2016-07-11 00:14:11','2016-07-11 00:14:11',155938),(397011,'syHlY7yudSvFM8q17P2X2Q','would you take $8 for the snaffle','2016-07-11 17:19:45','2016-07-11 17:19:45',156110),(397024,'w2n7jjSGdBUCrzcrUuWq-w','Katy,\n\nI\'d rather not.  At $350, all this stuff is a bargain.  I just want to be done with it.  Whoever buys it could sell what they don\'t want.  Sorry.\n\nJulie','2016-07-11 17:35:51','2016-07-11 17:35:51',155938),(398371,'24FLPFITJL-sn5q94CqVtw','Hi Alyssa: What size tree is a 4.5 please? I believe that would be a wide, because I know mefium is 4\", but I\'m not sure. Please advise and thank you.\r\n\r\nBonnie Erb \r\nWashington DC \r\n\r\n','2016-07-13 12:42:30','2016-07-13 12:42:30',156577),(398578,'3CPPkwN3bl0mjrRFkDFTJQ','I believe it is a wide as well. I used it on all of my warmbloods and it fit all of them since 2004! Well, except my new one of course. Has to be difficult.','2016-07-13 18:27:19','2016-07-13 18:27:19',156577),(398584,'24FLPFITJL-sn5q94CqVtw','Thank you! I need a medium, unfortunately but it\'s a nice saddle at a fair price. Hope it goes quickly for you! Cheers! Bonnie','2016-07-13 18:39:03','2016-07-13 18:39:03',156577),(399866,'J5vOGfWm48bKfXCt2f0_qg','photos of the helmet are now available','2016-07-15 23:58:25','2016-07-15 23:58:25',157132),(400046,'Bgqd7wbaw-WIeQnm3sO4WQ','Hello,\r\nI was going to purchase your Butet. It says you need to update info so that you can receive payment. ','2016-07-16 14:33:53','2016-07-16 14:33:53',157200),(400057,'3CPPkwN3bl0mjrRFkDFTJQ','Hi Amy! My PayPal seems to be giving me a problem. Do you happen to have an account with Chase and we can do it through Chase Quick Pay? Feel free to e-mail me Alyssa.r.converse@gmail.com','2016-07-16 15:13:50','2016-07-16 15:13:50',157200),(400058,'3CPPkwN3bl0mjrRFkDFTJQ','Or if you send me your PayPal e-mail I can request money from you','2016-07-16 15:15:36','2016-07-16 15:15:36',157200),(400063,'xOQvViY28S72S-tFFB0Tbw','Hey Alyssa,\r\n\r\nSomeone wants to buy your saddle, do you need any help setting up your payment info? she\'s unable to pay you until you authorize tackhunter to send you payments via paypal\r\n\r\nsee: https://www.tackhunter.com/en/aconverse/settings/payments/paypal_account\r\n\r\n','2016-07-16 15:38:35','2016-07-16 15:38:35',157206),(400065,'3CPPkwN3bl0mjrRFkDFTJQ','Just fixed it so payments can be received. Once I receive payment ill send the saddle right out','2016-07-16 15:48:19','2016-07-16 15:48:19',157200),(400068,'Bgqd7wbaw-WIeQnm3sO4WQ','I only have the PayPal..','2016-07-16 16:00:56','2016-07-16 16:00:56',157200),(400069,'Bgqd7wbaw-WIeQnm3sO4WQ','My paypal email is amy@tagalongfarm.com','2016-07-16 16:04:39','2016-07-16 16:04:39',157200),(400070,'3CPPkwN3bl0mjrRFkDFTJQ','I just set it up, you should be good to go to pay through the site! Please send me your mailing address as well, I will mail the saddle out first thing Monday morning and send you a tracking number once I get it.','2016-07-16 16:06:40','2016-07-16 16:06:40',157200),(400077,'Bgqd7wbaw-WIeQnm3sO4WQ','Awesome!! \nAmy Boyle-Keller \n1600 Governor Bridge Rd\nDavidsonville, Md. 21035\n443-336-9828','2016-07-16 16:38:10','2016-07-16 16:38:10',157200),(400080,'Bgqd7wbaw-WIeQnm3sO4WQ','Okay! Sent!! It says you have to accept it.  ','2016-07-16 16:43:18','2016-07-16 16:43:18',157200),(400130,'xOQvViY28S72S-tFFB0Tbw','Hey there,\r\n\r\nI was sent your feedback about the 1% fee. The issue should be resolved. There should not be any fees in the event that your items sell. Please let me know if there is anymore issues, I\'ll be sure to monitor any sales you have to ensure that you aren\'t charged.\r\n\r\nThanks for sharing your listings by the way! If you have any other issues you can message me here, or email me at admin@tackhunter.com\r\n\r\n- Phillip','2016-07-16 19:03:42','2016-07-16 19:03:42',157241),(400137,'Xsu9wdMHwrkxV4LnKm5-Zg','Thanks! ','2016-07-16 19:17:52','2016-07-16 19:17:52',157241),(400177,'xOQvViY28S72S-tFFB0Tbw','hi','2016-07-16 20:07:04','2016-07-16 20:07:04',157264),(400179,'zCbYTJlHA3h08RQCoybCrw','can you try again it didn\'t go through!','2016-07-16 20:15:10','2016-07-16 20:15:10',157264),(400180,'xOQvViY28S72S-tFFB0Tbw','here you go','2016-07-16 20:15:53','2016-07-16 20:15:53',157265),(400183,'zCbYTJlHA3h08RQCoybCrw','gotcha will send soon','2016-07-16 20:17:45','2016-07-16 20:17:45',157265),(400187,'xOQvViY28S72S-tFFB0Tbw','trying again\r\n','2016-07-16 20:27:33','2016-07-16 20:27:33',157268),(400189,'zCbYTJlHA3h08RQCoybCrw','ill send it soon!','2016-07-16 20:32:13','2016-07-16 20:32:13',157268),(400213,'Bgqd7wbaw-WIeQnm3sO4WQ','Just checking to see if it all went through..I was at a horse show today and was doing it from the phone!','2016-07-16 23:16:46','2016-07-16 23:16:46',157200),(400214,'3CPPkwN3bl0mjrRFkDFTJQ','It did come through! Will send out Monday morning and send you tracking!','2016-07-16 23:27:36','2016-07-16 23:27:36',157200),(400215,'Bgqd7wbaw-WIeQnm3sO4WQ','yay!!','2016-07-16 23:28:41','2016-07-16 23:28:41',157200),(400242,'Ea_YnW_MhxWWFbSj5bqcgQ','Hi Elizabeth, I hope your saddle is still for sale. I used to own one of these saddles and loved it. I am looking at getting back into riding again and would love to buy the saddle from you. \r\n\r\nCheers \r\nErin ','2016-07-17 03:55:53','2016-07-17 03:55:53',157281),(400244,'GMjvsADAj5TkxzlryIaEKA','What are the measurement ','2016-07-17 04:14:45','2016-07-17 04:14:45',157283),(400245,'q4kfy5acukx9O140BGPp9Q','29inches in the bust & 21inches in the arms, with room in the arms and waist to be let out..for the bust you could be a 30-32 and fit it still. ','2016-07-17 04:30:09','2016-07-17 04:30:09',157283),(400254,'im4NGTswqpsUQ5IjGq6iLg','Hi, it is still available. Let me know if you have any questions or would like additional photos. Thanks, Elizabeth','2016-07-17 05:37:07','2016-07-17 05:37:07',157281),(400438,'Ea_YnW_MhxWWFbSj5bqcgQ','Hi Elizabeth, thank you for your response. I am in Calgary Alberta Canada, do you have an estimated shipping cost. Has the saddle been re flocked at all and is the tree in good shape. ','2016-07-17 14:33:16','2016-07-17 14:33:16',157281),(400441,'Ea_YnW_MhxWWFbSj5bqcgQ','OH sorry one more question, how is it shipped to ensure no damage to it. I am guessing with fragile stickers and what not.   Thanks Erin ','2016-07-17 14:37:42','2016-07-17 14:37:42',157281),(400444,'im4NGTswqpsUQ5IjGq6iLg','Saddle has not been reflocked. It hasn\'t had all that much use over the years. Tree is good. It will be shipped in a box with bubblewrap, foam padding. I\'ll have to go to post office tomorrow to find out how much it will cost to ship to Alberta. I\'ve only shipped to US destinations before.','2016-07-17 14:49:29','2016-07-17 14:49:29',157281),(400446,'Ea_YnW_MhxWWFbSj5bqcgQ','Hi Elizabeth I would like to purchase the saddle. \n\nCheers \n\nErin ','2016-07-17 14:52:03','2016-07-17 14:52:03',157389),(400448,'im4NGTswqpsUQ5IjGq6iLg','Thanks Erin! I\'ll ship it tomorrow and send you the tracking number. I love this saddle, and am still sad I\'m too big for it now. I hope you love it as much as I do! ','2016-07-17 15:03:36','2016-07-17 15:03:36',157389),(400456,'Ea_YnW_MhxWWFbSj5bqcgQ','Do I mark it as completed once I receive it in the condition as advertised, sorry have not used this site before.  I will take great care of it, I used to have one and loved it, I evented with it. Thank Erin ','2016-07-17 15:15:33','2016-07-17 15:15:33',157389),(400529,'im4NGTswqpsUQ5IjGq6iLg','Yes, I\'ll send it with signature required and once you receive it on your end then you confirm it as completed. ','2016-07-17 17:26:58','2016-07-17 17:26:58',157389),(400567,'xOQvViY28S72S-tFFB0Tbw','Hey Cindy,\r\n\r\nThanks for your listings. Unfortunately I had to close the one regarding the Ranch Horseshow. In the future we\'ll have options to share events and non-tangible goods, but we currently do have a great way to do that. We ask that you only post items that can be sold, and put event notifications and updates in your bio.\r\n\r\nThanks!\r\nPhillip ','2016-07-17 18:39:07','2016-07-17 18:39:07',157432),(400576,'TlonokE18cOYIGiMQvAOaQ','I would be willing to trade my saddles for your saddle. I have two others that are for sale.','2016-07-17 18:51:32','2016-07-17 18:51:32',157434),(400594,'1cvzgkeG4sOBRRb9uA-Vuw','thanks','2016-07-17 19:35:30','2016-07-17 19:35:30',157432),(400659,'YHPkIeUujae_6dEvvsYdwQ','I have too many saddles as it is, and selling them is difficult. Thanks though!','2016-07-17 23:37:57','2016-07-17 23:37:57',157434),(400686,'9y0uWU9zImuQ69SeSKoo-A','Both the bridles do have reins!','2016-07-18 01:28:36','2016-07-18 01:28:36',157480),(400937,'UYbg1LfCoeSwdqLo5KVfuA','Hi - can you tell me what model your saddle is? ','2016-07-18 12:09:05','2016-07-18 12:09:05',157579),(401031,'Ea_YnW_MhxWWFbSj5bqcgQ','HI Elizabeth, just wondering if you were able to figure out the shipping cost And if I will need to pay anymore upon arrival.  \n\nCheers \n\nErin ','2016-07-18 14:35:08','2016-07-18 14:35:08',157389),(401038,'im4NGTswqpsUQ5IjGq6iLg','I\'ll be going over to the Post Office around lunchtime, so I don\'t have an answer yet on the shipping. ','2016-07-18 14:41:18','2016-07-18 14:41:18',157389),(401039,'Ea_YnW_MhxWWFbSj5bqcgQ','OK no worries \n\nThanks ','2016-07-18 14:44:56','2016-07-18 14:44:56',157389),(401042,'Ea_YnW_MhxWWFbSj5bqcgQ','You can ship it ground if it is cheaper. I am sure you will do this, but can you please place fragile stickers on it.  \n\nThanks ','2016-07-18 14:47:19','2016-07-18 14:47:19',157389),(401088,'3CPPkwN3bl0mjrRFkDFTJQ','Hey! Just sent the saddle out via FedEx, tracking number 783600227037. Should be to you tomorrow! Just let me know when it gets to you.','2016-07-18 15:38:43','2016-07-18 15:38:43',157200),(401198,'Bgqd7wbaw-WIeQnm3sO4WQ','Great!!!','2016-07-18 18:08:19','2016-07-18 18:08:19',157200),(401238,'im4NGTswqpsUQ5IjGq6iLg','Hi Erin-\nThe saddle is on it\'s way!  I sent it via FedEx, it was a few bucks cheaper and it will get there in five business days instead of 6-10 days from the Post office.  The total to ship was $78.09.  The tracking number is 783603241441.  A signature is required for delivery, and the package is insured for $475.  I used an entire roll of bubble wrap, stuffed the box with packing paper and put fragile stickers all over it.  It should arrive safe and sound.  :-)','2016-07-18 19:09:01','2016-07-18 19:09:01',157389),(401342,'im4NGTswqpsUQ5IjGq6iLg','Hi Erin-\nDo you have my paypal info so you can send an additional US$38 to me for the difference in shipping internationally? I\'m not sure what paypal info you have since you paid via TackHunter on the purchase.','2016-07-18 22:31:37','2016-07-18 22:31:37',157389),(401381,'Ea_YnW_MhxWWFbSj5bqcgQ','HI Elizabeth, this was my next question for you lol. \nI think I asked it to remember my info. I do not have a pay pal account is there anyway I can send it the same way as the purchase. Maybe creat a add for something for the $38 and then I can purchase it but not actually. ','2016-07-19 02:06:28','2016-07-19 02:06:28',157389),(401382,'Ea_YnW_MhxWWFbSj5bqcgQ','Thank you for getting it the shipping sorted out.  ','2016-07-19 02:07:42','2016-07-19 02:07:42',157389),(401404,'im4NGTswqpsUQ5IjGq6iLg','Hi Phillip- Not sure if you can help me with this, but I\'ve sold my Crosby saddle to Erin C.  She paid for the saddle and the original shipping quote of $40, but the final shipping amount was $78 (saddle was shipped internationally to Canada).  She wants to pay me the additional $38, but we don\'t know how to do that.  Can you process another payment from her to me for the additional $38? ','2016-07-19 03:52:03','2016-07-19 03:52:03',155840),(401405,'im4NGTswqpsUQ5IjGq6iLg','I sent the admin a question on how to go about charging for the additional shipping.  We\'ll figure something out if they can\'t do an additional paypal transaction.  Thanks!','2016-07-19 03:56:31','2016-07-19 03:56:31',157389),(401720,'xOQvViY28S72S-tFFB0Tbw','Hey there,\n\nSorry for the delayed response. One of the best ways to handle this in the future is to verify shipping details before accepting the payment, that way you can revise the price before she purchases it. \n\nHowever, in this case we have three options:\n\n1)  you can create a temporary listing just for shipping charges and have her buy it\n\n2) you can just have her send you the funds via a paypal invoice for the additional shipping costs.\n\n3) you can have her send tackhunter the additional costs, and i\'ll forward them to you.\n\nThere isn\'t a way to retroactively change the amount that was charged short of refunding/repurchasing it. So it\'d probably be easier just to collect the extra 40 bucks straight through paypal if possible!\n\nKeep me posted, i\'d be more than happy to help where i can,\n- Phillip','2016-07-19 15:22:12','2016-07-19 15:22:12',155840),(401825,'xOQvViY28S72S-tFFB0Tbw','Hey Susie, would you mind making individual listings for your items. It\'s much easier for users to search and buy your tack if each item is listed as its own listing.\r\n\r\nAlso I updated your listing to exclude your personal info (I.e. Phone number), since our marketplace is public we want to make sure your personal information is safe!\r\n\r\n- Phillip','2016-07-19 18:19:52','2016-07-19 18:19:52',157936),(401875,'im4NGTswqpsUQ5IjGq6iLg','Ok, this was the response- \n\n\"Sorry for the delayed response. One of the best ways to handle this in the future is to verify shipping details before accepting the payment, that way you can revise the price before she purchases it.\nHowever, in this case we have three options:\n1) you can create a temporary listing just for shipping charges and have her buy it\n2) you can just have her send you the funds via a paypal invoice for the additional shipping costs.\n3) you can have her send tackhunter the additional costs, and i\'ll forward them to you.\nThere isn\'t a way to retroactively change the amount that was charged short of refunding/repurchasing it. So it\'d probably be easier just to collect the extra 38 bucks straight through paypal if possible!\"','2016-07-19 19:06:33','2016-07-19 19:06:33',157389),(401878,'im4NGTswqpsUQ5IjGq6iLg','Not sure if you have to have a Paypal account in order to pay me?  If your bank doesn\'t charge for an ACH transfer, maybe it would just be easiest to send $38 directly to my account from your bank?  What would be easiest for you? Or you can contact Tackhunter and figure out how to do option 3.  Whatever you\'re most comfortable with.\n','2016-07-19 19:08:05','2016-07-19 19:08:05',157389),(401890,'Ea_YnW_MhxWWFbSj5bqcgQ','I can create a pay pal account and then provide you with the information. I will have to do it later today. ','2016-07-19 19:16:41','2016-07-19 19:16:41',157389),(402044,'Bgqd7wbaw-WIeQnm3sO4WQ','So.. FedEx in my area are stupid!! So I am leaving a message for them to leave the saddle or actually check the barn before leaving! They did come today and did not see me jumping up and down and flailing my arms like an idiot. LOL','2016-07-19 22:59:47','2016-07-19 22:59:47',158027),(402059,'3CPPkwN3bl0mjrRFkDFTJQ','Oh my gosh what a bunch of idiots. I love it when that happens, its always when its a good package too!!','2016-07-19 23:40:51','2016-07-19 23:40:51',158027),(402070,'Bgqd7wbaw-WIeQnm3sO4WQ','I know! I\'m like, wait!!! That\'s my saddle!!! LOL','2016-07-20 00:11:57','2016-07-20 00:11:57',158027),(402071,'YpdRRK705LmO_SWhpQNRoQ','Hi Maddie!! Would you take $75 for this one? ','2016-07-20 00:14:13','2016-07-20 00:14:13',158037),(402081,'9y0uWU9zImuQ69SeSKoo-A','yes! ','2016-07-20 01:09:41','2016-07-20 01:09:41',158037),(402091,'qviGWyLlo1hHVM2hnroyJg','Kris - this may sound silly but I don\'t have a specific model listed on the saddle. It is a handmade Barnsby saddle with a wide tree.  But unfortunately, there isn\'t a model stamped anywhere on it. It was that way when I purchased it slightly used a year ago. And I barely used it because I switched into a Voltaire after we decided against dressage for my new horse. ','2016-07-20 01:50:14','2016-07-20 01:50:14',157579),(402095,'YpdRRK705LmO_SWhpQNRoQ','Do you have Paypal? I can send you a payment through PayPal or I can mail you a money order. Let me know and thanks!','2016-07-20 01:58:59','2016-07-20 01:58:59',158037),(402124,'9y0uWU9zImuQ69SeSKoo-A','yep! it\'s tbrock1824@charter.net. what\'s ur address? it\'s 85 cuz 10 bucks to ship','2016-07-20 03:25:38','2016-07-20 03:25:38',158037),(402137,'YpdRRK705LmO_SWhpQNRoQ','My address is Allye Deskins, 2364 Waterfall Lane, Columbus, Ohio 43209','2016-07-20 04:14:49','2016-07-20 04:14:49',158037),(402138,'YpdRRK705LmO_SWhpQNRoQ','Ok sent it!!!','2016-07-20 04:19:07','2016-07-20 04:19:07',158037),(402141,'9y0uWU9zImuQ69SeSKoo-A','Thx!','2016-07-20 04:35:40','2016-07-20 04:35:40',158037),(402336,'UYbg1LfCoeSwdqLo5KVfuA','Wow ok,can you tell me if its wool or latex flocked? ','2016-07-20 10:48:01','2016-07-20 10:48:01',157579),(402431,'qviGWyLlo1hHVM2hnroyJg','Perhaps there\'s some confusion. This is an English all purpose saddle referred to as a wide tree ( for hunter) sAll leather. It\'s in the picture.  No other material like wool or flocking','2016-07-20 13:09:39','2016-07-20 13:09:39',157579),(402441,'UYbg1LfCoeSwdqLo5KVfuA','The flocking is on the underside of the saddle, it\'s what cushions it between the tree and the horse. It\'s made of either wool or latex','2016-07-20 13:24:59','2016-07-20 13:24:59',157579),(402721,'Ea_YnW_MhxWWFbSj5bqcgQ','HI Elizabeth, I have attempted to set up a paypal account last night and this morning. It does not like my phone number, I am doing this from my iPad. I do not have a computer. Can you set up a fake add then I can use the same payment method as I did for the saddle ','2016-07-20 19:05:24','2016-07-20 19:05:24',157389),(402860,'im4NGTswqpsUQ5IjGq6iLg','Ok, I\'ll put a listing up for the extra shipping right now. I\'ll stick it under the miscellaneous section.  Elizabeth','2016-07-21 01:13:23','2016-07-21 01:13:23',157389),(402862,'im4NGTswqpsUQ5IjGq6iLg','Thanks.  Erin couldn\'t get a paypal account set up, so I just did a listing for the shipping fee so she can pay for it that way.  ','2016-07-21 01:16:11','2016-07-21 01:16:11',155840),(402889,'HIFCh_ae5fN9w3vwv9VMWQ','What is the gullet size? Does it have a suede seat? Thank you.','2016-07-21 03:30:50','2016-07-21 03:30:50',158380),(403069,'6g0JMEjWwa1LrxpWidWvbw','Hi  Here are the particulars off the Courts website:\nTree: Reiner style, ralide, full quarter horse bars and gullet, 5 year guarantee. \n\nSeat: 16\", Smooth padded.\nSwell: 12 \nGullet: W/7 x H/8 \nCantle: 4 Oval, 2 leather cheyenne roll.  \nSkirts: Round, fleece lined, 26 1/2 x 12. \nFender Inseam: 31 to 37 \nWeight: 30 Pounds.\nThanks!','2016-07-21 10:58:05','2016-07-21 10:58:05',158380),(403355,'xOQvViY28S72S-tFFB0Tbw','Hey Carolin,\r\n\r\nThanks for using tack hunter. Unfortunately we don\'t have the ability to support the sale of dogs / animals on our platform. We don\'t have the expertise necessary to ensure our customers are fully protected. I\'ll need to close the listings for now, but I encourage you to check back in the future, because we may expand things down the road.','2016-07-21 19:15:19','2016-07-21 19:15:19',158561),(404804,'TbyxAV-R8xOaLGM6-PmNQA','Hi Maddie! Is the price of the Beval saddle you are selling negotiable at all? I am interested in purchasing it.\r\n\r\nThanks!\r\nLiv','2016-07-25 00:53:05','2016-07-25 00:53:05',159124),(404812,'9y0uWU9zImuQ69SeSKoo-A','Yes it is!  What is your offer?','2016-07-25 01:27:53','2016-07-25 01:27:53',159124),(404818,'TbyxAV-R8xOaLGM6-PmNQA','I was thinking $1250 shipped! Does that sound reasonable to you?\n\nThank you :)\nLiv','2016-07-25 01:41:55','2016-07-25 01:41:55',159124),(405124,'9y0uWU9zImuQ69SeSKoo-A','Hmm... Could you go up to 1300 plus shipping?','2016-07-25 13:46:18','2016-07-25 13:46:18',159124),(405131,'9y0uWU9zImuQ69SeSKoo-A','Or 1250 plus shipping','2016-07-25 14:02:21','2016-07-25 14:02:21',159124),(405162,'TbyxAV-R8xOaLGM6-PmNQA','I\'m sorry I think I have to stick to the $1250! Already going a bit over budget haha. I totally understand if you can\'t take that offer, though.\n\nThank you for your time :)','2016-07-25 14:40:17','2016-07-25 14:40:17',159124),(405203,'9y0uWU9zImuQ69SeSKoo-A','I\'ll take the 1250. Plz send it to my paypal tbrock1824@charter.net','2016-07-25 15:56:42','2016-07-25 15:56:42',159124),(405206,'9y0uWU9zImuQ69SeSKoo-A','I think you\'ll really love the saddle! Its in like perf condition!','2016-07-25 15:57:12','2016-07-25 15:57:12',159124),(405217,'TbyxAV-R8xOaLGM6-PmNQA','Great thank you, Maddie! I just sent the payment. Here is my shipping address:\n\nOlivia Tyler\n136 South Rd\nSomers CT 06071','2016-07-25 16:19:02','2016-07-25 16:19:02',159124),(405239,'9y0uWU9zImuQ69SeSKoo-A','Will ship today!','2016-07-25 16:53:47','2016-07-25 16:53:47',159124),(405303,'TbyxAV-R8xOaLGM6-PmNQA','Awesome thanks again! ;)','2016-07-25 18:26:40','2016-07-25 18:26:40',159124),(405335,'9y0uWU9zImuQ69SeSKoo-A','yep!','2016-07-25 19:00:25','2016-07-25 19:00:25',159124),(405403,'xOQvViY28S72S-tFFB0Tbw','Hey Ellen, \r\n\r\nYour books look great! However, we\'re currently a marketplace for used horse tack and equipment. We don\'t have the infrastructure in place to sell retail items / publications, so I\'ll need to close your listings. In the future , we may support these type of listings, so stay tuned!\r\n\r\nThanks,\r\nPhillip / The Tack Hunter Crew','2016-07-25 20:15:25','2016-07-25 20:15:25',159344),(405436,'xOQvViY28S72S-tFFB0Tbw','Hey Maddy,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 20:53:03','2016-07-25 20:53:03',159356),(405438,'xOQvViY28S72S-tFFB0Tbw','Hey Nichole,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 20:53:29','2016-07-25 20:53:29',159357),(405442,'xOQvViY28S72S-tFFB0Tbw','Hey Taylor,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter \r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 20:56:41','2016-07-25 20:56:41',159360),(405451,'xOQvViY28S72S-tFFB0Tbw','Hey Michelle,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 21:01:38','2016-07-25 21:01:38',159362),(405454,'xOQvViY28S72S-tFFB0Tbw','Hey Natalie,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 21:02:05','2016-07-25 21:02:05',159363),(405456,'xOQvViY28S72S-tFFB0Tbw','Hey Melissa,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 21:02:25','2016-07-25 21:02:25',159364),(405457,'xOQvViY28S72S-tFFB0Tbw','Hey Helen,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 21:02:43','2016-07-25 21:02:43',159365),(405460,'xOQvViY28S72S-tFFB0Tbw','Hey Kate,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 21:04:38','2016-07-25 21:04:38',159366),(405461,'xOQvViY28S72S-tFFB0Tbw','Hey Jaclyn,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 21:06:12','2016-07-25 21:06:12',159367),(405463,'xOQvViY28S72S-tFFB0Tbw','Hey Kayla,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 21:06:44','2016-07-25 21:06:44',159369),(405464,'xOQvViY28S72S-tFFB0Tbw','Hey Sara,\r\n\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-25 21:07:28','2016-07-25 21:07:28',159370),(405534,'b_5Pg76G_9IQaKLvcsQ_ig','Hi \nWhy do you need my info right away if nobody has expressed interest in my saddle? \n\nIs there a fee involved in the saddle being on the site? ','2016-07-25 23:16:48','2016-07-25 23:16:48',159366),(405538,'xOQvViY28S72S-tFFB0Tbw','Well the way our site works is people can buy items directly on tackhunter.com. this means safer transactions for our buyers, and sellers. However, we require that our sellers have their paypal account set up so that we can send them payments in the event that their item sells. As it stands, potential buyers are unable to purchase your item, because your account isn\'t fully set up yet.\n\nIf you take a few moments and complete the set up process, you\'ll be all set!\n\n\nRe: commission - we currently have the lowest fee in the industry. it\'s completely free to list as many items as you want. if your item sells, then we charge a 3% fee off the selling price. \n\n- Phillip / The Tack Hunter Crew','2016-07-25 23:31:54','2016-07-25 23:31:54',159366),(405542,'XktoJSe0bJJLhsyJzPq0fg','I\'ll set up paypal if/when I get a buyer through your service.  As yet I\'ve not had even an inquiry....','2016-07-26 00:06:41','2016-07-26 00:06:41',159365),(405557,'xOQvViY28S72S-tFFB0Tbw','\r\nHey Helen,\r\nCan you update your payment settings (click on your username -> settings -> payments, and complete the setup instructions), we need this completed so that we can send you payments in the event that your item sells on Tack Hunter\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-26 01:04:30','2016-07-26 01:04:30',159410),(406137,'TbyxAV-R8xOaLGM6-PmNQA','Hi there, \n\nJust letting you know I received the saddle today (that shipping was super fast!) and it looks great! Thank you again :)','2016-07-26 18:15:42','2016-07-26 18:15:42',159124),(406148,'9y0uWU9zImuQ69SeSKoo-A','Np!  Glad you like it!','2016-07-26 18:30:41','2016-07-26 18:30:41',159124),(406219,'TbyxAV-R8xOaLGM6-PmNQA','Sorry to bother you again - just wondering if you know what year the saddle is? I can\'t find the marking anywhere!','2016-07-26 19:46:11','2016-07-26 19:46:11',159124),(406363,'9y0uWU9zImuQ69SeSKoo-A','I don\'t for sure know exactly, but i think it\'s a 2012','2016-07-26 23:34:06','2016-07-26 23:34:06',159124),(406741,'b_5Pg76G_9IQaKLvcsQ_ig','Hello\nI am not an advance business member therefore they will not allow me to grant permission through PayPal\nI don\'t know if there is a way around this?','2016-07-27 12:08:02','2016-07-27 12:08:02',159366),(406787,'xOQvViY28S72S-tFFB0Tbw','Sure, I\'d love to help:\n\nTack Hunter allows buyers to purchase items using either a credit/debit card, or via paypal. This helps sellers reach more people, and makes it easier for buyers to purchase items. Note that all transactions are still protected through paypal\'s protection (even the credit/debit card transactions!)\n\nHowever, this means that sellers sometimes need to upgrade their paypal account (if they haven\'t already). It\'s completely free to do so, and honestly it makes paypal much more useful if you\'re selling things.\n\nHere\'s the steps i took, and it only took like 1-2 minutes:\n\n- go to: https://www.paypal.com/us/merchantsignup/applicationChecklist?signupType=CREATE_NEW_ACCOUNT&productIntentId=wp_standard\n\n- once you login it\'ll ask you for some info. for the business name, simply enter something that best describes what you\'re doing if you don\'t have a business e.g. \"saddle sales\".\n\n- on the \"tell us about your business page\"\n  - select \"individual / sole proprietorship\" (unless you\'re actually a business)\n  - under category, select \"retail (not elsewhere classified)\"\n  - under sub category, select \"used & secondhand goods\"\n\nlastly, follow the few remaining steps and you\'re all set!\n\nPlease let me know if you have any other questions, I\'d love to help get your saddles listed and sold!','2016-07-27 13:25:38','2016-07-27 13:25:38',159366),(407065,'xOQvViY28S72S-tFFB0Tbw','Hey Bridgette: two quick things,\r\n\r\n- we had to remove the phone number from your listing. our site is public and we need to make sure that your personal information is safe. we recommend that you communicate via private messages on tackhunter if you want to exchange phone numbers.\r\n\r\n- You\'ll need to complete your payment setup before someone can purchase your saddle (click on your username -> settings -> payments), we need this so that we can send you payments in the event that your item sells.\r\n\r\nThanks!\r\nPhillip / The Tack Hunter Crew','2016-07-27 18:43:35','2016-07-27 18:43:35',159925),(407166,'g1f0FEaJuaLItOb3s_Etkg','How do I go about removing my listing? I was unaware that I was required to pay to post anything ','2016-07-27 20:01:40','2016-07-27 20:01:40',159925),(407212,'xOQvViY28S72S-tFFB0Tbw','You can close your listing if you visit the listing\'s page and click \"close listing\". Note that we only charge 3% of the selling price, and you\'re only charged if it sells. It\'s completely free otherwise.','2016-07-27 21:08:54','2016-07-27 21:08:54',159925),(408262,'vr4ApsoQnThnJFgIIYfxjw','What make is the saddle? Do you have additional photos?My e-mail address is cbk1996@aol.com\r\n\r\nThank you.','2016-07-29 12:13:17','2016-07-29 12:13:17',160383),(408532,'FeFCuR1nrRpk4IeQQhYVLg','Hi, is this still available?','2016-07-29 17:34:20','2016-07-29 17:34:20',160480);
